DROP TABLE IF EXISTS `html_gmap_piechart_sample`;

CREATE TABLE `html_gmap_piechart_sample` (
    `id`                          int(11) NOT NULL auto_increment,
    `latitude`                    double,
    `longitude`                   double,
    `name`                        varchar(30),
    `specialty`                   varchar(30),  
    `insurance`                   char(3),
    PRIMARY KEY                 (`id`),
    KEY                         (`latitude`),
    KEY                         (`longitude`),
    KEY                         (`specialty`),
    KEY                         (`insurance`)
    ) ENGINE=MyISAM;

